			cmp bx, 10
			je pos_nave ;Asteroides no futuro
			lodsw
			cmp ax, 0
			je findx
			inc bx
			jmp next_shot
		findx:
			cmp bx, cx
			je endx
			inc cx
			inc di
			jmp findx
		endx:
			call store_nextx
		findy:
			cmp bx, cx
			je endy
			inc cx
			inc di
			jmp findy
		endy:
			call store_nexty
			jmp tiros
		store_nextx:
			mov si, nave_y
			lodsb
			add ax, 8
			stosw
			mov cx, 0
			mov di, tiros_y
			ret
		store_nexty:
			pop cx
			inc cx
			mov ax, cx
			stosw
			dec cx
			ret
			
	end:
		call video
		jmp $
